import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { PublicRoutes } from '~/routes';
function App() {
    return (
        <Router>
            <div className="App">
                <Routes>
                    {PublicRoutes.map((route, index) => (
                        <Route path={route.path} element={<route.component />} />
                    ))}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
